import React from 'react'

function Banner() {
  return (
    <div>
      <div className="container-fluid">
        <div className="banner_background">
         <img className="image_hidden" src="http://7-themes.com/data_images/out/32/6877267-mountain-scenery.jpg" />
        </div>
      </div>


    </div>
  )
}


export default Banner
